
select *
from dbo.zz_import_20100910_ins

alter table zz_import_20100910_ins add rowid int identity(1,1)

update zz_import_20100910_ins
set Phone=replace(phone, '(', '')
update zz_import_20100910_ins
set Phone=replace(phone, ')', '')
update zz_import_20100910_ins
set Phone=replace(phone, ' ', '')
update zz_import_20100910_ins
set Phone=replace(phone, '-', '')


update zz_import_20100910_ins
set Zip=replace(Zip, '-', '')

	select  
	'exec [dbo].[InsurancePlanDataProvider_CreateInsuranceCompany]
		@name = ''' + replace( ltrim(rtrim( replace(z.[INSURANCE_NAME], '''', '''''') )), '''', '''''') + ''',
		@street_1 = ''' + isnull( replace(Addr, '''', ''''''), '') + ''',
		@street_2 = '''',
		@city =''' + isnull(City, '') +''',
		@state = ''' + isnull([State], '') + ''',
		@country = '''',
		@zip = '''+ isnull(ZIP, '') +''',
		@contact_prefix = NULL,
		@contact_first_name = NULL,
		@contact_middle_name = NULL,
		@contact_last_name = NULL,
		@contact_suffix = NULL,
		@phone = '''+ isnull(Phone, '') +''',
		@phone_x = null,
		@fax = null,
		@fax_x = null,
		@notes = ''rowid:' + cast(rowid as varchar) + ''',
		@practice_id = 1,
		@BillingFormID = 13,
		@SecondaryPrecedenceBillingFormID =13,
		@AcceptAssignment = 0,
		@UseSecondaryElectronicBilling = 0,
		@UseCoordinationOfBenefits = 1,
		@ExcludePatientPayment = 0,
		@bill_secondary_insurance = 0,
		@review_code=''R'',
