alter table dbo.zz_import_20100910_ins add insuranceCompanyId int

declare @vendorImportId int
set @vendorImportId=2

update insuranceCompany
set VendorImportId=@vendorImportId
where cast(notes as varchar(max)) like 'rowid:%'
	and VendorImportId is null




-- get the recently inserted
update z
set VendorId=replace( cast(notes as varchar(max)), 'rowid:', '')
from insuranceCompany z
where VendorImportId = 2


update z
set Notes='Imported by Kareo, Sept 15, 2010'
from insuranceCompany z
where VendorImportId = 2

update z
set insuranceCompanyId=i.insuranceCompanyId
from insuranceCompany i
	inner join dbo.zz_import_20100910_ins z
		on z.rowId=i.vendorId
where VendorImportId = 2

		

		
-- Primry
select 
	'exec InsurancePlanDataProvider_CreateInsurancePlan 
		@name = ''' + replace( isnull(z.[INSURANCE_PLAN], ''), '''', '''''') + ''',
		@street_1 = ''' + isnull( replace(Addr, '''', '''''') , '') + ''',
		@street_2 = ''' + isnull(null, '') + ''',
		@city =''' + isnull( city, '') + ''',
		@state = ''' + isnull( state, '') + ''',
		@zip = ''' + isnull(cast( isnull(zip, '') as varchar(32)), '')+ '''
		
		,@program_code=N''CI''
		,@deductible=''' + cast( isnull(null, 0) as varchar(32)) + '''
		,@company_id=''' + cast( insuranceCompanyID as varchar(32)) + '''
		,@fax_x=NULL
		,@phone='''+ isnull(phone, '') +'''
		,@contact_suffix=NULL
		,@review_code=N''''
		,@phone_x=null
		,@contact_last_name=NULL
		,@fax=NULL
		,@notes=N''Imported by Kareo Sept 15, 2010''
		,@contact_prefix=NULL
		,@country=N''''
		,@contact_first_name=NULL
		,@copay=''' + cast( isnull(null, 0) as varchar(32)) + '''

		,@EClaimsAccepts=0
		,@practice_id= 1
		,@contact_middle_name=NULL'
	from dbo.zz_import_20100910_ins z
where insuranceCompanyID is not null





